import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App text-white">
      <div className='bg-black container-fluid'>
        <div className='row allign-middle'>
          <div className='col-lg-2'>
            <h1>Company Name</h1>
          </div>
          <div className='col-lg-6'> </div>
          <div className='col-lg-2'>
            <img src='Images/App_Store.svg' height={"200"}></img>
          </div>
          <div className='col-lg-2'>
            <img src='Images/google_Play.svg' height={"200"}></img>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
